  false,\n\t\"url\": null,\n\t\"notes\": \"Temperature profile data were collected
  from the SEA-LAND DEFENDER from January 1, 1994 to December 31, 1994. Data were
  submitted by Institut Francais De Recherche Pour L'Explitation De La Mer - Brest
